INSERT INTO "MESSAGE" VALUES ('P0000496', 'C0000001', TO_TIMESTAMP('2020-04-20 17:02:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '벚꽃 구경 갔어요?');
INSERT INTO "MESSAGE" VALUES ('P0000496', 'C0000001', TO_TIMESTAMP('2020-04-20 17:03:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '아직 안 갔어요.');
INSERT INTO "MESSAGE" VALUES ('P0000497', 'C0000001', TO_TIMESTAMP('2023-07-07 21:00:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '별빛이 예쁘네요.');
INSERT INTO "MESSAGE" VALUES ('P0000497', 'C0000001', TO_TIMESTAMP('2023-07-07 21:01:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '여름밤의 별이 좋아요.');
INSERT INTO "MESSAGE" VALUES ('P0000497', 'C0000001', TO_TIMESTAMP('2023-07-07 21:02:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '같이 별 보러 가요?');
INSERT INTO "MESSAGE" VALUES ('P0000497', 'C0000001', TO_TIMESTAMP('2023-07-07 21:03:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '기다리고 있을게요.');
INSERT INTO "MESSAGE" VALUES ('P0000498', 'C0000001', TO_TIMESTAMP('2022-10-31 23:00:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '할로윈 파티 갔어요?');
INSERT INTO "MESSAGE" VALUES ('P0000498', 'C0000001', TO_TIMESTAMP('2022-10-31 23:01:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '올해는 안 갔어요.');
INSERT INTO "MESSAGE" VALUES ('P0000498', 'C0000001', TO_TIMESTAMP('2022-10-31 23:02:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '저도 집에서 쉬었어요.');
INSERT INTO "MESSAGE" VALUES ('P0000498', 'C0000001', TO_TIMESTAMP('2022-10-31 23:03:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '다음 해에 같이 가요.');
INSERT INTO "MESSAGE" VALUES ('P0000499', 'C0000001', TO_TIMESTAMP('2021-01-01 00:00:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '새해 복 많이 받으세요.');
INSERT INTO "MESSAGE" VALUES ('P0000499', 'C0000001', TO_TIMESTAMP('2021-01-01 00:01:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '감사합니다! 좋은 한 해 되세요.');
INSERT INTO "MESSAGE" VALUES ('P0000499', 'C0000001', TO_TIMESTAMP('2021-01-01 00:02:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '다짐은 했나요?');
INSERT INTO "MESSAGE" VALUES ('P0000499', 'C0000001', TO_TIMESTAMP('2021-01-01 00:03:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '네, 올해는 더 열심히 살아보려고요.');
INSERT INTO "MESSAGE" VALUES ('P0000500', 'C0000001', TO_TIMESTAMP('2022-08-15 10:00:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '광복절입니다.');
INSERT INTO "MESSAGE" VALUES ('P0000500', 'C0000001', TO_TIMESTAMP('2022-08-15 10:01:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '역사를 잊지 말아야 해요.');
INSERT INTO "MESSAGE" VALUES ('P0000500', 'C0000001', TO_TIMESTAMP('2022-08-15 10:02:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 1, '맞아요, 고마운 분들이 많죠.');
INSERT INTO "MESSAGE" VALUES ('P0000500', 'C0000001', TO_TIMESTAMP('2022-08-15 10:03:00.123', 'YYYY-MM-DD HH24:MI:SS.FF'), 0, '올바른 미래를 위해 기억해야겠죠.');
