-----------------------------------------
-----------------------------------------
--         UPDATE ROOM's GATE          --
-----------------------------------------
-----------------------------------------


UPDATE ROOM R
SET R.gate = '0'
WHERE REGEXP_LIKE(R.room_id, '^R.....0[1-9]$') OR REGEXP_LIKE(R.room_id, '^R.....1[0-9]$') OR REGEXP_LIKE(R.room_id, '^R.....20$');

UPDATE ROOM R
SET R.gate = '1'
WHERE REGEXP_LIKE(R.room_id, '^R.....2[1-9]$') OR REGEXP_LIKE(R.room_id, '^R.....3[0-9]$') OR REGEXP_LIKE(R.room_id, '^R.....40$');

UPDATE ROOM R
SET R.gate = '2'
WHERE REGEXP_LIKE(R.room_id, '^R.....4[1-9]$') OR REGEXP_LIKE(R.room_id, '^R.....5[0-9]$') OR REGEXP_LIKE(R.room_id, '^R.....60$');

UPDATE ROOM R
SET R.gate = '3'
WHERE REGEXP_LIKE(R.room_id, '^R.....6[1-9]$') OR REGEXP_LIKE(R.room_id, '^R.....7[0-9]$') OR REGEXP_LIKE(R.room_id, '^R.....80$');

UPDATE ROOM R
SET R.gate = '4'
WHERE REGEXP_LIKE(R.room_id, '^R.....8[1-9]$') OR REGEXP_LIKE(R.room_id, '^R.....9[0-9]$') OR REGEXP_LIKE(R.room_id, '^R.....00$');

COMMIT;

